import Navbar from "./components/Navbar/Navbar";
import Home from "./components/Home/Home";
import { BrowserRouter,Swich,Route } from 'react-router-dom'
import { Container } from "@material-ui/core";
const App = () => {

    return(
        <BrowserRouter>
        <Container maxidth="lg">
            <Navbar/>
            <Home/>

        </Container>
        </BrowserRouter>
    )



}

export default App;
